import React, { useEffect, useRef } from 'react'

function Focus() {

    useEffect(()=>{
          //focus on the input box

          let ref=useRef()
    },[])
    return (
        <>
                <input type='text' ref={ref}/>
        </>
    )
}

export default Focus
